            {...rest}
            render={() => {
                return isPrivate === !!UserToken?  <Component/>  :  <Redirect to={isPrivate? 
                    '/'
                    : userData.type==='parent'? ('/dashboardparents') : (userData.type === 'children'? '/dashboardkids': '/') 
                    }/>
            }}
        />
    )
}

export default Route
